import React from 'react'
import styled from 'styled-components';

const ReviewCardWrap = styled.div`
    border: 1px solid gray;
    width: 45%;
    border-radius: 3px;

`

function ReviewCard() {
    return (
        <ReviewCardWrap>
            <div>제목</div>
            <div>나의 별점</div>
            <div>후기 내용 ...</div>
            <div>더보기</div>
        </ReviewCardWrap>
    )
}

export default ReviewCard
